import React from "react";

const ImageCard = (props) => {
  const { alt_description, urls, user } = props.image;
  return (
    <div className="box">
      <img src={urls.regular} alt={alt_description} className="gallery-item" />

      <div className="d-flex justify-content-center align-items-center m-5 border border-primary">
        <a
          target="_blank"
          href={`https://www.instagram.com/${user.instagram_username}`}
        >
          <i className="fab fa-instagram"></i>
        </a>
      </div>
    </div>
  );
};

export default ImageCard;
